//TileSet Module
var TileSet = new function() {
	//Constants
	var DRAW_BOUNDING_BOX = false;	
	var TYPES = [
		{name:'queen', scale: 20}, 
		{name:'ant', scale: 20}, 
		{name:'beetle', scale: 20}, 
		{name:'hopper', scale: 20}, 
		{name:'spider', scale: 10}, 
		{name:'ladybug', scale: 30}, 
		{name:'mosquito', scale: 20}, 
		{name:'pillbug', scale: 0}
	];
	var TYPE_NAMES = ['queen', 'ant', 'beetle', 'hopper', 'spider', 'ladybug', 'mosquito', 'pillbug'];
	
	//Scoped variables		
	var metadata = [
		{name:'official white', path: 'img/official/white', ext: 'svg'},
		{name:'official black', path: 'img/official/black', ext: 'svg'},
		
		{name:'blue', path: 'img/cartoon/blue', ext: 'png', outline:'#50b8d5', scale:true},
		{name:'gray', path: 'img/cartoon/gray', ext: 'png', outline:'#98968d', scale:true},
		{name:'green', path: 'img/cartoon/green', ext: 'png', outline:'#93cb5a', scale:true},
		{name:'orange', path: 'img/cartoon/orange', ext: 'png', outline:'orange', scale:true},
		{name:'purple', path: 'img/cartoon/purple', ext: 'png', outline:'#8b59c8', scale:true},
		{name:'red', path: 'img/cartoon/red', ext: 'png', outline:'#c85c59', scale:true},
		{name:'multi-colored', path: 'img/cartoon/multi-colored', ext: 'png', outline:'#000', scale:true},
		{name:'minimal white', path: 'img/minimal/white', ext: 'svg'},
		{name:'minimal black', path: 'img/minimal/black', ext: 'svg'},
	];
	
	var cur;
	var images = [];//[SetId][TileType]
	this.activeImages = [[],[]]; //[Player],[TileType]
	
	//Public	
	this.init = function(onLoaded) {
		//Init images length
		for (var m = 0; m < metadata.length; m++) {
			images.push([]);
		}
		
		var setId1 = menu.tileSet1;
		var setId2 = menu.tileSet2;
		var self = this;
		cur = [setId1, setId2];
		
		loadTiles(setId1, function() { 	
			self.activeImages[PLAYER1] = images[setId1];		
			loadTiles(setId2, function() {
				self.activeImages[PLAYER2] = images[setId2];	
				onLoaded();
			});				
		});
	}

	this.getNames = function() { //For menu
		var names = {};
		for (var m = 0; m < metadata.length; m++) {
			var meta = metadata[m];
			names[meta.name] = m;
		}
		return names;
	}
	
	this.setActive = function(player, setId) {				
		var self = this;
		loadTiles(setId, function() {		
			cur[player] = setId;
			self.activeImages[player] = images[setId];
		});
	}
	
	this.draw = function(ctx, x, y, tileType, player, alpha) {
		var set = cur[player];
		var meta = metadata[set];
		
		//Bounding box
		if (DRAW_BOUNDING_BOX) ctx.strokeRect(x, y, HEX_TILE, HEX_TILE); 
		
		//Outline
		if (meta.outline) {			
			fillHex(ctx, x, y, 'rgba(255, 255, 255, 0.5');
			strokeHex(ctx, x, y, meta.outline, 3);	
		}
						
		//Rotate tile
		ctx.save();
		if (alpha) ctx.globalAlpha = alpha;
		
		ctx.translate(x, y);
		if (player == PLAYER1) ctx.rotate(HEX_ANGLE*Math.PI/180);
		else ctx.rotate(-HEX_ANGLE*Math.PI/180);
		
		if (meta.scale) {			
			var scale = TYPES[tileType].scale;			
			var halfScale = scale/2;
			ctx.drawImage(images[set][tileType], -HEX_TILE_CENTER_X + halfScale, -HEX_TILE_CENTER_Y + halfScale, HEX_TILE_X - scale, HEX_TILE_Y - scale);
		}
		else ctx.drawImage(images[set][tileType], -HEX_TILE_CENTER_X, -HEX_TILE_CENTER_Y, HEX_TILE_X, HEX_TILE_Y);		
					
		ctx.restore();
	}
	
	
	//Private
	//Recursive loading loop
	function loadTiles(setId, onLoaded) {
		if (images[setId].length) onLoaded(); //Tiles already loaded
		else loadTilesLoop(0, setId, onLoaded);
	}
	
	function loadTilesLoop (i, setId, onLoaded) { 
		var meta = metadata[setId];
		var img = new Image();	
		img.onload = function() {			
			
			if (i+1 >= TYPES.length) onLoaded(); //Finished
			else loadTilesLoop(i+1, setId, onLoaded); //Recurse
		}
				
		var src = meta.path + '/' + TYPES[i].name + '.' + meta.ext;		
		img.src = src;			
		images[setId].push(img);
	}
}

//End TileSet Module